// https://leetcode.com/problems/simple-bank-system
class Bank {
public:
    vector<long long> v;
    Bank(vector<long long>& balance) {
        v = balance;
    }
    
    bool transfer(int account1, int account2, long long money) {
        account1--;
        account2--;
        if(account1 >= 0 && account1 < v.size() && account2 >= 0 && account2 < v.size() && v[account1] >= money){
            v[account1] -= money;
            v[account2] += money;
            return true;
        }
        return false;
    }
    
    bool deposit(int account, long long money) {
        account--;
        if(account >= 0 && account < v.size()){
            v[account] += money;
            return true;
        }
        return false;
    }
    
    bool withdraw(int account, long long money) {
        account--;
        if(account >= 0 && account < v.size() && v[account] >= money){
            v[account] -= money;
            return true;
        }
        return false;
    }
};

